import './App.css';

function App() {
  return <div>
    <h1>Wines</h1>
    <div classname='card'>
      <h2>Wine Name</h2>
      <div classname ='actions'>
        <button classname='btn'>Info</button> 
      </div> 
    </div>
  </div>;
}

export default App;
